import * as FAIcons from "react-icons/fa";
import * as AIIcons from "react-icons/ai";

const sidebarData = [
    {
        title:'Home',
        path:'/',
        icon:<AIIcons.AiFillHome/>,
        cname:'nav-text'
    },
    {
        title:'Courses',
        path:'/courses',
        icon:<AIIcons.AiFillHome/>,
        cname:'nav-text'
    },
    {
        title:'About US',
        path:'/aboutus',
        icon:<AIIcons.AiFillHome/>,
        cname:'nav-text'
    }
]
export default sidebarData;
